import React from "react";
import "./Learn.css";

const Learn = () => {
  return (
    <a
      href="https://drive.google.com/drive/folders/1TRlIYXPLPazrJb2lHQp5hmymqS4wj-Lx?usp=sharing"
      target="_blank"
    >
      <div id="learn">
        <i className="fa fa-book" aria-hidden="true"></i> <span>Learn</span>
      </div>
    </a>
  );
};

export default Learn;
